import { Outlet } from "react-router-dom";
import { Header, Footer } from '../../Components';

function BasicLayout () {
    return (
        <>
            <Header></Header>
            <main>
                <Outlet />
            </main>
            <Footer></Footer>
        </>
    );
}

export default BasicLayout;
